RestrictedUDPSocketAsyncWaiter::RestrictedUDPSocketAsyncWaiter(RestrictedUDPSocket* proxy)
    : proxy_(proxy)
{
}

RestrictedUDPSocketAsyncWaiter::~RestrictedUDPSocketAsyncWaiter() = default;

void RestrictedUDPSocketAsyncWaiter::Send(::base::span<const ::uint8_t> data, int32_t* out_result)
{
    base::RunLoop loop;
    proxy_->Send(std::move(data),
        base::BindOnce(
            [](base::RunLoop* loop, int32_t* out_result, int32_t result) {
                *out_result = std::move(result);
                loop->Quit();
            },
            &loop, out_result));
    loop.Run();
}

int32_t RestrictedUDPSocketAsyncWaiter::Send(::base::span<const ::uint8_t> data)
{
    int32_t async_wait_result;
    Send(std::move(data), &async_wait_result);
    return async_wait_result;
}

void RestrictedUDPSocketAsyncWaiter::SendTo(
    ::base::span<const ::uint8_t> data, const ::net::HostPortPair& dest_addr, ::net::DnsQueryType dns_query_type, int32_t* out_result)
{
    base::RunLoop loop;
    proxy_->SendTo(std::move(data), std::move(dest_addr), std::move(dns_query_type),
        base::BindOnce(
            [](base::RunLoop* loop, int32_t* out_result, int32_t result) {
                *out_result = std::move(result);
                loop->Quit();
            },
            &loop, out_result));
    loop.Run();
}

int32_t RestrictedUDPSocketAsyncWaiter::SendTo(::base::span<const ::uint8_t> data, const ::net::HostPortPair& dest_addr, ::net::DnsQueryType dns_query_type)
{
    int32_t async_wait_result;
    SendTo(std::move(data), std::move(dest_addr), std::move(dns_query_type), &async_wait_result);
    return async_wait_result;
}

